import React, { useState, useEffect } from "react";
import axios from "axios";

function Statas() {
  const [usersCount, setUsersCount] = useState(0);
  const [ordersCount, setOrdersCount] = useState(null);
  const [productsCount, setProductsCount] = useState(null);


  async function getUserCount (){
    try {
        const response = await axios.get("http://localhost:5002/users");
        setUsersCount(response.data.users.length);
      } catch (error) {}
  }
  useEffect(() =>{
    getUserCount()
  }, [])
  useEffect(() => {
    // Fetch the number of users
    // Fetch the number of orders
    axios
      .get("your_orders_api_endpoint")
      .then((response) => setOrdersCount(response.data))
      .catch((error) => console.error("Error fetching orders count:", error));

    // Fetch the number of available products
    axios
      .get("your_products_api_endpoint")
      .then((response) => setProductsCount(response.data))
      .catch((error) => console.error("Error fetching products count:", error));
  }, []); // The empty dependency array ensures that this effect runs once when the component mounts

 


  return (
    <div>
      <div className="m-6">
        <div className="flex flex-wrap -mx-6">
          {/* Display the number of users */}
          <div className="w-full px-6 sm:w-1/2 xl:w-1/3">
            <div className="flex items-center px-5 py-6 shadow-sm rounded-md bg-slate-100">
              <div className="mx-5">
              <svg
            className="h-8 w-8 text-white"
            viewBox="0 0 28 30"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              d="M18.2 9.08889C18.2 11.5373 16.3196 13.5222 14 13.5222C11.6804 13.5222 9.79999 11.5373 9.79999 9.08889C9.79999 6.64043 11.6804 4.65556 14 4.65556C16.3196 4.65556 18.2 6.64043 18.2 9.08889Z"
              fill="currentColor"
            />
            <path
              d="M25.2 12.0444C25.2 13.6768 23.9464 15 22.4 15C20.8536 15 19.6 13.6768 19.6 12.0444C19.6 10.4121 20.8536 9.08889 22.4 9.08889C23.9464 9.08889 25.2 10.4121 25.2 12.0444Z"
              fill="currentColor"
            />
            <path
              d="M19.6 22.3889C19.6 19.1243 17.0927 16.4778 14 16.4778C10.9072 16.4778 8.39999 19.1243 8.39999 22.3889V26.8222H19.6V22.3889Z"
              fill="currentColor"
            />
            <path
              d="M8.39999 12.0444C8.39999 13.6768 7.14639 15 5.59999 15C4.05359 15 2.79999 13.6768 2.79999 12.0444C2.79999 10.4121 4.05359 9.08889 5.59999 9.08889C7.14639 9.08889 8.39999 10.4121 8.39999 12.0444Z"
              fill="currentColor"
            />
            <path
              d="M22.4 26.8222V22.3889C22.4 20.8312 22.0195 19.3671 21.351 18.0949C21.6863 18.0039 22.0378 17.9556 22.4 17.9556C24.7197 17.9556 26.6 19.9404 26.6 22.3889V26.8222H22.4Z"
              fill="currentColor"
            />
            <path
              d="M6.64896 18.0949C5.98058 19.3671 5.59999 20.8312 5.59999 22.3889V26.8222H1.39999V22.3889C1.39999 19.9404 3.2804 17.9556 5.59999 17.9556C5.96219 17.9556 6.31367 18.0039 6.64896 18.0949Z"
              fill="currentColor"
            />
          </svg>
                <h4 className="text-2xl font-semibold text-gray-700">
                  {usersCount !== null ? usersCount : "Loading..."}
                </h4>

                <div className="text-gray-500">Users</div>
              </div>
            </div>
          </div>

          {/* Display the number of orders */}
          <div className="w-full mt-6 px-6 sm:w-1/2 xl:w-1/3 sm:mt-0">
            <div className="flex items-center px-5 py-6 shadow-sm rounded-md bg-slate-100">
              <div className="mx-5">
                <h4 className="text-2xl font-semibold text-gray-700">
                  {ordersCount !== null ? ordersCount : "Loading..."}
                </h4>
                <div className="text-gray-500">Total Orders</div>
              </div>
            </div>
          </div>

          {/* Display the number of available products */}
          <div className="w-full mt-6 px-6 sm:w-1/2 xl:w-1/3 xl:mt-0">
            <div className="flex items-center px-5 py-6 shadow-sm rounded-md bg-slate-100">
              <div className="mx-5">
                <h4 className="text-2xl font-semibold text-gray-700">
                  {productsCount !== null ? productsCount : "Loading..."}
                </h4>
                <div className="text-gray-500">Available Products</div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Statas;
